import React from 'react'
import Navbar from './userComponent/Navbar'
import "./UserDashboard.css";
import postComplaint from './userComponent/postComplaint';
import myComplaint from './userComponent/myComplaint';
import Profile from './userComponent/Profile';
import {Route, BrowserRouter,Routes} from 'react-router-dom'


function UserDashboard() {
  return (
    <div>
    <BrowserRouter>
    <Navbar/>
    <Routes>
    <Route path='/profile' exact component={Profile} />
    <Route path='/postComplaint' component={postComplaint} />
    <Route path='/myComplaint' component={myComplaint} />
    </Routes>
    </BrowserRouter>
    
    </div>
    
  )
  
}

export default UserDashboard
